import { pagelinks } from "../pagelinks"
import { sociallinks } from "../pagelinks"


export default function Footer(){
    return(
        <footer className="section footer">
        <ul className="footer-links">


          {pagelinks.map(link => <li><a href={link.href} className="footer-link">{link.text}</a></li>)}

        </ul>
        <ul className="footer-icons">

        {sociallinks.map(data => <li key={data.id}>
              <a href={data.href} target='_blank' rel='noreferrer' className='footer-icon'> <i className={data.classname}></i>  </a>
            </li>)}

        </ul>
        <p className="copyright">
          copyright &copy; Backroads travel tours company
          <span id="date"></span> all rights reserved
        </p>
      </footer>
    )
}
